sources.sass\\components\\_modal-header-window.s:
.backdrop-header {
  position: fixed;
  z-index: 100;
  top: 0%;
  left: 0%;
  width: 100vw;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.2);
  visibility: visible;
  opacity: 1;
  pointer-events: auto;
  transition: opacity var(--transition-duration), visibility var(--transition-duration);
}

.backdrop-header.is-hidden {
  visibility: hidden;
  opacity: 0;
  pointer-events: none;
}

.modal-header {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translateX(-50%) translateY(-50%);
  width: 90vw;
  max-width: 450px;
  height: 95vh;
  max-height: 610px;
  overflow: auto;
  box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.12), 0px 1px 1px rgba(0, 0, 0, 0.14),
    0px 2px 1px rgba(0, 0, 0, 0.2);
  background-color: var(--secondary-background);
  border-radius: 4px;

  @media screen and (min-width: 1280px) {
    max-width: 528px;
    max-height: 582px;
  }
}
.modal-header__button--close {
  position: absolute;
  top: 8px;
  right: 8px;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 30px;
  height: 30px;
  padding: 0;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-radius: 50%;
  background-color: transparent;
  cursor: pointer;
}
.modal-header__icon {
  width: 11px;
  height: 11px;
  fill: var(--logo);
  transition: fill var(--transition-duration);
  .modal__button:hover & {
    fill: var(--main-title-color);
  }
}
.modal-form {
  padding: 30px 15px 15px;
  @media screen and (min-width: 480px) {
    padding: 40px;
  }
}

.modal-form__title {
  width: 100%;
  margin-bottom: 12px;
  text-align: center;
  font-weight: 700;
  font-size: 20px;
  line-height: calc(30 / 20);
  color: var(--main-title-color);
  @media screen and (min-width: 1280px) {
    font-size: 20px;
    line-height: 1.15;
  }
}

.modal-form__infoblock {
  display: block;
  margin-bottom: 10px;
}

.modal-form__label {
  display: block;
  margin-bottom: 4px;
  font-size: 12px;
  line-height: 1.16;
  letter-spacing: 0.01em;
  color: var(--main-title-color);
}

.modal-form__wrap {
  position: relative;
  display: block;
}

.modal-form__input {
  display: block;
  width: 100%;
  height: 40px;
  padding: 12px 10px 12px 42px;
  border: 1px solid rgba(33, 33, 33, 0.2);
  border-radius: 4px;
  transition: border-color var(--transition-duration);
  outline: var(--secondary-background);
  &:focus {
    border-color: var(--secondary-title-color);
  }
}

.modal-form__icon {
  position: absolute;
  left: 15px;
  top: 50%;
  transform: translateY(-50%);
  fill: var(--main-title-colo);
  transition: fill var(--transition-duration) var(--cubic);
  .modal-form__input:focus + & {
    fill: var(--secondary-title-color);
  }
}

.modal-form__comment {
  resize: none;
  padding: 12px 16px;
  width: 100%;
  height: 120px;
  border: 1px solid rgba(33, 33, 33, 0.2);
  border-radius: 4px;
  transition: border-color var(--transition-duration);
  &:focus {
    border-color: var(--secondary-title-color);
  }
  &::placeholder {
    font-size: 12px;
    line-height: 1.16;
    letter-spacing: 0.01em;
    color: var(--main-title-color);
  }
}
.modal-submit-btn {
  margin-right: auto;
  margin-left: auto;
}

