/* PROCES CSS */

.process-section {
  background-image: url('../images/process/bg-milk-process-section-mobile.png');
  background-repeat: no-repeat;
  background-size: 100%;
  background-position: 0 50%;
  background-color: var(--main-background);
  padding-top: 125px;
  padding-bottom: 97px;

  @media (min-device-pixel-ratio: 2),
    (-webkit-min-device-pixel-ratio: 2),
    (min-resolution: 192dpi),
    (min-resolution: 2dppx) {
    background-image: url('../images/process/bg-milk-process-section-mobile-@2x.png');
  }

  @media screen and (min-width: 768px) {
    background-image: none;
    padding-top: 130px;
    padding-bottom: 140px;
  }

  @media screen and (min-width: 1280px) {
    background-image: url('../images/process/bg-milk-process-section-desktop.png');
    background-repeat: no-repeat;
    background-size: 100%;
    background-position: 0 60%;
    padding-top: 125px;
    padding-bottom: 139px;

    @media (min-device-pixel-ratio: 2),
      (-webkit-min-device-pixel-ratio: 2),
      (min-resolution: 192dpi),
      (min-resolution: 2dppx) {
      background-image: url('../images/process/bg-milk-process-section-desktop-@2x.png');
    }
  }
}

.process-top-header {
  font-family: var(--header-font-family);
  font-size: 18px;
  line-height: 21px;
  text-align: center;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: var(--worktime-color);

  @media screen and (min-width: 768px) {
    font-size: 26px;
    line-height: 30px;
  }

  @media screen and (min-width: 1280px) {
    font-size: 30px;
    line-height: 34px;
  }
}

.process-title {
  font-family: var(--header-font-family);
  font-size: 34px;
  line-height: 39px;
  text-align: center;
  letter-spacing: 0.06em;
  text-transform: uppercase;
  color: var(--main-title-color);
  margin-top: 15px;

  @media screen and (min-width: 768px) {
    font-size: 48px;
    line-height: 55px;
  }

  @media screen and (min-width: 1280px) {
    font-size: 58px;
    line-height: 66px;
  }
}

.description-container {
  margin-top: 26px;
  font-family: var(--main-font-family);
  display: block;
  margin-bottom: 40px;
  align-items: center;

  @media screen and (min-width: 768px) {
    margin-top: 100px;
    display: flex;
    margin-bottom: 66px;
  }

  @media screen and (min-width: 1280px) {
    margin-bottom: 40px;
  }
}

.img-cow {
  margin-left: auto;
  margin-right: auto;
  margin-bottom: 46px;

  @media screen and (min-width: 768px) {
    margin-right: 17px;
    position: relative;
    top: -50px;
  }
  @media screen and (min-width: 1280px) {
    margin-right: 74px;
    top: 50px;
  }
}

.description-item1 {
  font-weight: 500;
  font-size: 12px;
  line-height: 176%;
  letter-spacing: 0.04em;
  color: var(--main-text-color);
  margin: 0 auto;
  margin-bottom: 47px;

  @media screen and (min-width: 768px) {
    font-size: 14px;
    margin-bottom: 49px;
  }
  @media screen and (min-width: 1280px) {
    font-size: 16px;
    margin-bottom: 35px;
  }
}

.description-item2,
.description-item3 {
  font-style: normal;
  font-weight: 500;
  font-size: 12px;
  line-height: 194%;
  letter-spacing: 0.04em;
  color: var(--paragraph-text-color);
  margin: 0 auto;

  @media screen and (min-width: 768px) {
    font-size: 14px;
  }
  @media screen and (min-width: 1280px) {
    font-size: 14px;
  }
}

.description-item3 {
  margin-top: 15px;
}

.list-container {
  display: block;
  max-width: 220px;
  margin: 0 auto;

  @media screen and (min-width: 480px) {
    max-width: 100%;
  }

  @media screen and (min-width: 768px) {
    max-width: 340px;
  }
  @media screen and (min-width: 1280px) {
    max-width: 463px;
  }
}

.button-icon {
  fill: var(--main-title-color);
  margin-left: 13px;
}

.btn-margin {
  margin-top: 17px;

  @media screen and (min-width: 768px) {
    margin-top: 62px;
  }
  @media screen and (min-width: 1280px) {
    margin-top: 45px;
  }
}

.definitions-list {
  display: block;

  @media screen and (min-width: 768px) {
    display: flex;
  }
  @media screen and (min-width: 1280px) {
    display: flex;
  }
}

.definitions-list__containers {
  &:not(:last-child) {
    margin-bottom: 38px;
  }
  max-width: 220px;

  @media screen and (min-width: 768px) {
    &:not(:last-child) {
      margin-right: 60px;
      margin-bottom: 0;
    }
    max-width: 180px;
  }
  @media screen and (min-width: 1280px) {
    &:not(:last-child) {
      margin-right: 30px;
    }
    max-width: 330px;
    display: block;
  }
}

.definitions-img {
  margin-bottom: 16px;

  @media screen and (min-width: 768px) {
    margin-bottom: 36px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 40px;
  }
}

.definitions-subtitle {
  font-family: var(--header-font-family);
  font-weight: normal;
  text-align: left;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: var(--main-title-color);
  font-size: 36px;
  line-height: 41px;
  margin-bottom: 15px;

  @media screen and (min-width: 768px) {
    font-size: 48px;
    line-height: 55px;
  }
  @media screen and (min-width: 1280px) {
    font-size: 58px;
    line-height: 66px;
  }
}

.definitions-text {
  font-family: var(--main-font-family);
  font-weight: bold;
  font-size: 12px;
  line-height: 170%;

  letter-spacing: 0.02em;
  color: var(--main-text-color);

  @media screen and (min-width: 768px) {
    font-size: 14px;
    line-height: 174%;
  }
  @media screen and (min-width: 1280px) {
    font-size: 16px;
    line-height: 176%;
  }
}

sources.sass\\layout\\_products.scss:
.product__title {
  position: relative;
  align-items: center;
  flex-direction: column;
  display: flex;
  font-family: var(--header-font-family);
  font-size: 20px;
  line-height: 1.15;
  text-align: center;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: var(--secondary-text-color);
}

.product__title::after {
  content: '';
  display: block;
  width: 26px;
  height: 6px;
  position: absolute;
  background-image: url('../images/products/dots.png');
  top: 50px;
}
.container--pudding {
  padding-bottom: 98px;
  padding-top: 130px;
}
.products__list {
  margin-top: 145px;
}
.products__list li {
  position: relative;
  padding-left: 40px;
  padding-right: 40px;
  padding-bottom: 40px;
  padding-top: 154px;
  border-radius: 24px;
  margin-top: 130px;
  &:first-child {
    background-color: var(--secondary-background);
  }
  &:nth-child(2) {
    background-color: #f0d1a5;
  }
  &:last-child {
    background-color: #c2e297;
  }
}
.product__text {
  font-size: 14px;
  color: var(--secondary-text-color);
  line-height: 1.5;
  text-align: center;
  letter-spacing: 0.04em;
  margin-top: 66px;
}
.product__overlay-parag {
  font-size: 14px;
}
.product__wrapper {
  position: absolute;
  top: -120px;
  left: 0px;
  width: 100%;
}
.product__img {
  margin: 0 auto;
}
.product__btn {
  width: 40px;
  height: 40px;
  margin: 0 auto;
  margin-top: 40px;
}
.description-button__icon--big {
  height: 15px;
  width: 15px;
  transition: transform 500ms cubic-bezier(1, 0, 1, 0.32);
}
.product__btn:active .description-button__icon--big {
  transform: rotate(-90deg);
}
.description-button__icon.overlay__btn {
  transform: rotate(-90deg);
  transition: transform 500ms cubic-bezier(1, 0, 1, 0.32);
}
.product__btn:active .description-button__icon.overlay__btn {
  transform: rotate(90deg);
}

.product__overlay__img {
  width: 60%;
  margin: 0 auto;
}
.overlay__header {
  text-align: center;
  color: var(--main-title-color);
  font-family: var(--header-font-family);
}
@media screen and (min-width: 768px) {
  .products__list {
    display: flex;
    flex-wrap: wrap;
    margin-left: -20px;
  }

  .products__list li {
    padding-left: 10px;
    padding-right: 12px;
    margin-top: 0;
    width: calc((100% - 60px) / 3);
    margin-left: 20px;
  }
}
@media screen and (min-width: 1280px) {
  .products__list {
    margin-top: 254px;
    margin-left: -30px;
  }
  .products__list li {
    width: calc((100% - 90px) / 3);
    padding-top: 168px;
    margin-left: 30px;
  }

  .product__btn {
    margin-top: 60px;
  }
  .product__title {
    font-size: 30px;
  }
  .product__title::after {
    top: 68px;
  }
  .product__text {
    font-size: 16px;
  }
  .product__wrapper {
    top: -193px;
  }
  .product__overlay-parag {
    font-size: 16px;
  }
}
.product__overlay {
  font-size: 18px;
  line-height: 1.55;
  letter-spacing: 0.03em;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  color: var(--secondary-text-color);
  padding: 63px 24px;
  transition: opacity 500ms cubic-bezier(0.4, 0, 0.2, 1),
    visibility 500ms cubic-bezier(0.4, 0, 0.2, 1);
  opacity: 0;
  pointer-events: none;
  visibility: hidden;
  border-radius: 24px;
}
.products__list li {
  &:first-child .product__overlay {
    background-color: rgba(255, 184, 202, 0.9);
  }
  &:nth-child(2) .product__overlay {
    background-color: rgba(240, 209, 165, 0.9);
  }
  &:last-child .product__overlay {
    background-color: rgba(194, 226, 151, 0.9);
  }
}
.isShown {
  opacity: 1;
  visibility: visible;
  pointer-events: auto;
}
.overlay__wrapper {
  height: 287px;
  overflow-y: scroll;
}

sources.sass\\layout\\_worktime.scss:
.worktime {
  padding-top: 80px;
  padding-bottom: 80px;
  font-size: 12px;
  line-height: 1.6;
  font-weight: 500;
  background-image: linear-gradient(to top, var(--main-background) 90%, #ffffff 10%);
  @media screen and (min-width: 768px) {
    font-size: 14px;
    line-height: 1.8;
    background-image: linear-gradient(to top, var(--main-background) 80%, #ffffff 20%);
  }
  @media screen and (min-width: 1280px) {
    font-size: 16px;
    line-height: 1.8;
    background-image: url(../images/worktime/sectionbg.png),
      linear-gradient(to top, var(--main-background) 78%, #ffffff 24%);
    background-repeat: no-repeat;
    background-size: contain;
    background-position-y: 30%;
  }
  @media screen and (min-device-pixel-ratio: 2) and (min-width: 1200px),
    (min-resolution: 192dpi) and (min-width: 1200px),
    (min-resolution: 2dppx) and (min-width: 1200px) {
    background-image: url(../images/worktime/sectionbg@2x.png);
  }
}

.worktime__conteiner {
  display: flex;
  flex-direction: column;
  @media screen and (min-width: 768px) {
    flex-direction: row;
    flex-wrap: wrap;
  }
}

.worktime__item:not(:last-child) {
  padding-bottom: 25px;
  margin-bottom: 25px;
  border-bottom: 1px solid #e1e1e1;
  @media screen and (min-width: 768px) {
    padding-bottom: 30px;
    margin-bottom: 30px;
  }
}
.worktime__head-title {
  background-color: #f0d1a5;
  width: 80px;
  text-align: center;
  border-radius: 4px;
  margin-bottom: 25px;
  &.foodtruck {
    width: 130px;
    background-color: #c2e297;
  }
  @media screen and (min-width: 768px) {
    margin-bottom: 30px;
  }
}
.worktime__head {
  color: #ffffff;
  text-transform: uppercase;
}

.worktime__company {
  padding: 40px 20px;
  background-color: #ffffff;
  border-radius: 24px;
  box-shadow: 0px 8px 30px 0px #d414431a;
  @media screen and (max-width: 767px) {
    margin-left: auto;
    margin-right: auto;
    &:not(:last-child) {
      margin-bottom: 20px;
    }
  }

  @media screen and (min-width: 768px) {
    padding: 50px 30px;
    max-width: 220px;
    &:not(:last-child) {
      margin-right: 20px;
    }
  }
  @media screen and (min-width: 1280px) {
    padding: 50px 40px;
    max-width: 330px;
    &:not(:last-child) {
      margin-right: 30px;
    }
  }
}

.worktime__paragraph {
  color: var(--paragraph-text-color);
  font-size: 1.4;
}

.worktime__city li:not(:last-child),
.worktime__days:not(:last-child) {
  margin-bottom: 10px;
  @media screen and (min-width: 768px) {
    margin-bottom: 15px;
  }
}

.worktime__hours {
  color: var(--worktime-color);
}

.worktime__tel,
.worktime__mail {
  color: #907e82;
  font-size: 1.4;
}

.worktime__buttons {
  display: flex;
  justify-content: center;
  margin-top: 80px;
  @media screen and (max-width: 767px) {
    flex-wrap: wrap;
    margin-left: auto;
    margin-right: auto;
    max-width: 320px;
    .main-button--dark {
      margin-bottom: 10px;
    }
  }
  @media screen and (min-width: 768px) {
    .main-button--dark {
      margin-right: 15px;
    }
  }
}

sources.sass\\layout\\_modal-window.scss:
/* MODAL WINDOW CSS  */
.backdrop {
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  background: rgba(0, 0, 0, 0.2);
  z-index: 90;

  opacity: 1;
  visibility: visible;
  pointer-events: auto;
  /* transition: opacity 500ms cubic-bezier(0.4, 0, 0.2, 1),
    visibility 500ms cubic-bezier(0.4, 0, 0.2, 1); */
  transition: opacity var(--transition-duration), visibility var(--transition-duration);

  &.is-hidden {
    opacity: 0;
    visibility: hidden;
    pointer-events: none;
  }
}

.modal {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 300px;
  height: 480px;
  background-color: #fff;
  padding: 40px;
  background-color: #ffe1e8;
  border-radius: 10px;
  border: 4px solid #fff;

  @media screen and (min-width: 768px) {
    width: 400px;
    height: 500px;
  }

  @media screen and (min-width: 1200px) {
    width: 500px;
    height: 500px;
    left: 70%;
  }
}

.close-button {
  position: absolute;
  top: 8px;
  right: 8px;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-radius: 50%;
  background-color: transparent;
  padding: 0;
  width: 30px;
  height: 30px;
  cursor: pointer;
  border: none;

  transition-property: fill;
  transition-duration: 250ms;

  &:hover,
  &:focus {
    fill: var(--accent-color);
  }
}

.modal-icon {
  fill: #000000;
  font-weight: bolder;
}

.modal-text {
  font-style: normal;
  font-weight: bold;
  font-size: 12px;
  line-height: 162%;
  letter-spacing: 0.04em;
  color: #000000;
  text-align: center;
  margin-bottom: 10px;

  @media screen and (min-width: 768px) {
    font-size: 14px;
    line-height: 176%;
  }

  @media screen and (min-width: 1280px) {
    font-size: 16px;
    line-height: 176%;
  }
}

.milk-box {
  margin: 0 auto;
  text-align: center;
}
